import React, { Component } from "react";
import "../Style/AdminContent.css";

class AdminContent extends Component {
  render() {
    return (
      <div className="admin-dashboard">
        <h2> Ati intrat pe dashboard-ul de admin(WIP).</h2>{" "}
        <table id="houses-data">
			<thead>
				<tr>
					<th>Zone</th>
					<th>Area</th>
					<th>Rooms</th>
					<th>Bathrooms</th>
					<th>Parking Lots</th>
					<th>Floor</th>
					<th>Animal</th>
					<th>Furnished</th>
				</tr>	
			</thead>	
		</table>{" "}
      </div>
    );
  }
}

export default AdminContent;
